import React, { Component } from "react"


export default class DogInfo extends Component {

    render(){
        return(
            <>
            <img src = {this.props.currentDog.image}>  </img>
            <h2>{this.props.currentDog.name}</h2>
            {this.props.currentDog.isGoodDog? <button onClick= {this.props.toggleGood}>Good Dog!</button> : <button onClick= {this.props.toggleGood}>Bad Dog!</button> }
            </>
        )
    }
}
